tables.table_schema:
CREATE TABLE quantum_protocols (
    protocol_id UUID PRIMARY KEY,
    protocol_name VARCHAR(50) NOT NULL,
    protocol_description TEXT,
    created_date TIMESTAMP NOT NULL
);

CREATE TABLE quantum_protocols (
    protocol_id INT PRIMARY KEY,
    protocol_name VARCHAR(255) NOT NULL,
    description TEXT,
    algorithm VARCHAR(50)
);

CREATE TABLE protocol_results (
    result_id INT PRIMARY KEY,
    protocol_id INT,
    result_value VARCHAR(255) NOT NULL,
    result_date DATE
);

CREATE TABLE Quantum_Protocols (
    protocol_id UUID PRIMARY KEY,
    protocol_name VARCHAR(255) NOT NULL,
    protocol_description TEXT,
    key_exchange_method VARCHAR(100)
);

CREATE TABLE Protocol_Users (
    user_id UUID PRIMARY KEY,
    user_name VARCHAR(255) NOT NULL,
    user_email VARCHAR(255) UNIQUE
);

CREATE TABLE quantum_protocols (
  protocol_id INT PRIMARY KEY,
  protocol_name VARCHAR,
  protocol_description TEXT,
  security_level VARCHAR
);

CREATE TABLE quantum_operators (
  operator_id INT PRIMARY KEY,
  operator_name VARCHAR,
  operator_type VARCHAR,
  operator_description TEXT
);
